INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(1, 'tanet', 'Es un detergente neutro multisuperficies con certificado Ecolabel. Agradablemente perfumado y educado para todas las superficies resistentes al agua. No irrita la piel y protege los materiales.', 4, ),
(3, 'TANET KARACHO', 'Es un limpiador ecológico con certificado Ecolabel y C2C. Extremadamente respetuoso con los materiales y el medio ambiente. Sin tensioactivos, enzimas ni blanqueantes ópticos. Ideal para suelos microporosos, superficies textiles, moquetas y tapicerías.', 7.4, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(5, 'Grease Perfect', 'Es un desengrasante para cocinas con certificado Ecolabel y C2C. Si perfume. Alcalinidad media.', 7.8, ),
(6, 'MANUDISH SENSITIVE', 'Es un lavavajillas ecológico manual potente con certificado Ecolabel. Respeta los ciclos biológicos y protege la salud de las personas y la seguridad de los usuarios.', 4.2, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(9, 'emulgras', 'Es un desengrasante totalmente libre de cáusticos, especialmente indicado como quitagrasas, aceites y todo tipo de suciedad fuertemente adherida. Es un desengrasante ecológico para tejidos y ropa muy eficaz, especialmente en zonas con suciedades rebeldes como cuellos y puños. Cumple todos los requisitos exigidos por las normativas internacionales vigentes de calidad, biodegradabilidad y respeto al medio ambiente con CERTIFICADO DE PRODUCTO ECOLÓGICO ECOITEL NO CE-2667.', 5.78, ),
(11, 'D´CAL FLOR ESPUMA', 'Es un producto que elimina los restos de cal y óxidos producidos por el agua. Ideal para eliminar las incrustaciones que se producen en el baño, mamparas, grifería, \r\nfregaderos, etc.\r\nCumple todos los requisitos exigidos por las normativas internacionales vigentes de calidad, biodegradabilidad y respeto al medio ambiente con CERTIFICADO DE PRODUCTO ECOLÓGICO ECOITELN CE-32W7.\r\n', 5.33, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(12, 'AMBER ', 'Es un limpiador que actúa principalmente como desengrasante, por lo que su uso es ideal en cualquier superficie en la que se requiera la eliminación de restos de aceites o grasas.\r\nDestaca además de su eficacia su carácter amigable con el medio ambiente y para los operarios, como así lo indica la ausencia de símbolos de peligros CLP. No contiene alérgenos, fosfato o níquel.\r\n', 4.75, ),
(15, 'ECOTECH CUCUMBER ECO ', 'Está especialmente indicado para eliminar las huellas y manchas en cristales, espejos, mobiliario moderno, azulejos y acero inoxidable.\r\nSu fórmula es adecuado para utilizarla en la industria alimentaria y es un producto certificado con la etiqueta ecológica europea: ES-V/020/001.\r\nEl limpiador cuenta, además, con el certificado Ecolabel, que asegura el buen uso de los recursos naturales para su fabricación y los desechos que genera.\r\n', 9.2, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(16, 'ECOTECH GREEN CARE ', 'Está desarrollado con un pH neutro formulado con materias primas de origen vegetal y elevado nivel de biodegradabilidad que cuida y limpia la piel dejando un agradable perfume. Formulado con tensioactivos vegetales de bajo nivel de irritabilidad y gran poder emoliente, especial para usar en todo tipo de pieles, incluidas aquellas más delicadas.\r\nDiseñado en un formato de 500ml, cómodo y perfecto para su uso en el hogar, para todos los miembros de la familia. \r\n', 4.83, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(17, 'ECOTECH SET MATIC ', 'Es un detergente para lavavajillas ecológico de pH neutro formulado con materias primas de origen natural y elevado nivel de biodegradabilidad', 6.16, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(18, 'RUBY ', 'Cuenta con unos agentes antirredepositantes, que ayudan a prevenir la formación de incrustaciones. Contiene materias primas de origen vegetal derivadas de la remolacha de azúcar y del aceite de coco.\r\nNo desprenden olores desagradables o intensos, sino que deja ambientada la estancia con su perfume de vinagre de manzana.\r\n', 5.24, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(19, 'PINE ', 'Es un limpiador de eficacia probada, líder en el mercado, caracterizado por su eficacia como higienizante y por su elaboración con materias primas de origen vegetal y biodegradables.\r\nEste limpiador cuenta con el certificado Ecolabel: IT/020/009, que asegura el respeto hacia los recursos de la naturaleza en cuanto a su elaboración y los desechos que genera con su uso.\r\n', 4, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(20, 'DIAMOND ', 'Es un detergente natural multiusos elaborado con materias primas de origen vegetal, como por ejemplo tensioactivos, disolventes, derivadas de la remolacha de azúcar y del maíz. Es apto para entornos HACCP(Análisis de Peligros y de Puntos Críticos de Control). Producto respetuoso, sin fosfatos, sin níquel (inferior a 0,01 ppm). Se trata de un producto testado dermatológicamente y no está probado en animales.', 5.36, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(21, 'ECOTECH FLOOR ', 'Está especialmente indicado para la limpieza y mantenimiento de todo tipo de superficies lavables como suelos, azulejos, encimeras, sanitarios, mobiliario de oficina y colegios, etc. Debido su pH neutro.\r\nEl producto se encuentra certificado con la Etiqueta Ecológica Europea: ES-V/020/001, con tensioactivos sintéticos por otros procedentes de fuentes renovables', 5.25, );
INSERT INTO `productos` (`id_producto`, `nombre`, `descripcion`, `precio`, `imagen`) VALUES
(22, 'BLANCOLOR', 'es un detergente ecológico para lavadora o para lavar a mano diseñado para cuidar del medio ambiente al tiempo que lava todo tipo de ropa. Realza los colores y cuida la ropa, dejándola suave y agradablemente perfumada. Cumple todos los requisitos exigidos por las normativas internacionales vigentes de calidad, biodegradabilidad y respeto al medioambiente con CERTIFICADO DE PRODUCTO ECOLÓGICO ECOITEL No C-14268.', 13.9, );
